import React from "react";

const Nav = () => {
  return (
    <div className="nav">
      <div className="logo">
        <img src="./asset/urban_plantery.svg"></img>
      </div>
      <span>COLLECTION</span>
      <span>CONTACT</span>
    </div>
  );
};
export default Nav;
